.container {
  overflow: hidden;
  vertical-align: top;
  position: relative;
  background-color: #fff;
  outline: none;
  white-space: nowrap;
  display: table;
  table-layout: auto;
}
.container > * {
  height: 100% !important;
  display: table-cell !important;
  vertical-align: middle !important;
}
.border {
  border-style: solid;
  border-width: 1px;
}
/* 标题文本 */
.label {
  padding: 0 6px;
  white-space: nowrap;
  user-select: none;
  -webkit-user-select: none;
  -ms-user-select: none;
  -moz-user-select: none;
}
/* 必填 */
.required {
  padding: 0 2px;
  color: #f00;
  user-select: none;
  -webkit-user-select: none;
  -ms-user-select: none;
  -moz-user-select: none;
}
/* 禁止操作 */
.disabled {
  position: absolute;
  width: 100%;
  height: 100%;
  left: 0;
  top: 0;
  background-color: rgba(255, 255, 255, 0.6);
  opacity: 0.6;
  filter: alpha(opacity=60); 
  cursor: not-allowed;
}
